import {v4 as uuid} from 'uuid';


const initialState = {
    items: [
        {id: uuid(), name: "Eggs"},
        {id: uuid(), name: "Milk"},
        {id: uuid(), name: "Water"},
        {id: uuid(), name: "Cereal"}
    ]
};
